import { Layout, Heading } from "../../components";
import { Calendar } from "./";
import {
  Player_AddButton,
  Player_Card,
} from "../../../server/db/models/player";
import { Dash_View_Players_Styles } from "./Dash_Styles";
import { Team_Schedule } from "./Team";
const { Container } = Layout;

const billing = () => {
  return <Container>content</Container>;
};

const schedule = () => {
  return (
    <Container>
      <Heading style={{ textAlign: "right", borderBottom: "1px solid black" }}>
        Calendar
      </Heading>
      <Calendar />
    </Container>
  );
};

const players = () => {
  return (
    <Container>
      <Dash_View_Players_Styles className="PlayerView_Entry">
        <div className="PlayerView_Container Add_Player">
          <Player_AddButton />
          <Player_Card />
          <Player_Card />
        </div>
        <Team_Schedule className="PlayerView_Container" />
      </Dash_View_Players_Styles>
    </Container>
  );
};

const contact = () => {
  return <Container>content</Container>;
};
const Admin_View = {
  billing,
  schedule,
  contact,
  players,
};

const User_View = {
  billing,
  schedule,
  contact,
  players,
};

const Dash_Views = {
  Admin_View,
  User_View,
};

export default Dash_Views;
